import React from "react";
import Card from "./card";
import contacts from "../contacts";

function App() {
  return (
    <div>
      <h1 className="heading">My Contacts</h1>
      <Card name={contacts[0].name} 
      img={contacts[0].imgURL} 
      tel= {contacts[0].tel} 
      email={contacts[0].email}  />
      <Card name="JACK" img="https://pbs.twimg.com/profile_images/625247595825246208/X3XLea04_400x400.jpg" tel="901895464" email="justin@gmail.com"/>
    </div>
  );
}

export default App;
